import React from "react";
import "./Sidebar.css"

export default function SideBar() {
    return (
        <div className="sidenav">
            <LevelCounter/>
        </div>
    )
}

function LevelCounter() {
    return (
        <div className="level-counter">
            <p className="counter">Level { } of { }</p>
            <div className="checkmark">
            </div>
        </div>
    )
}
